import React from 'react'
import App from '../App'

const Intro = () => {
    const style = {
        "backgroundImage": `url("images/bgimg2.jpg")`,
        "backgroundRepeat": "no-repeat",
        "backgroundSize": "cover",
        position: "absolute",
        height: "100%",
        width: "100%",
        text : "Welcome"
    }
    const header = {
        fontsize: "80px",
        color: "#363030",
        textalign: "center"
    }
    return <div style={style}> <h1 style={header}>Welcome to the Medicare. An online medicines seller</h1></div>
}
    function HomePage() {
        return <div>
            <Intro />
        </div>
    }


export default HomePage
